import AsyncStorage from "@react-native-async-storage/async-storage";

const servers = async ()=>{
    try {
    const ararangua = await AsyncStorage.getItem('Ararangua');
    const criciuma = await AsyncStorage.getItem('Criciuma');
    switch (true) {
        case ararangua !== null: return 'http://ti.ararangua.sc.gov.br:10000';
        case criciuma !== null: return 'http://ti.criciuma.sc.gov.br:00000';
        default:
                return 'default.server.url';
        }
} catch (error) {
    console.error("Erro ao acessar o AsyncStorage:", error);
    return 'error.server.url';
}
};
export default servers;
